postgresql to get npu users who booked got yoga dietplan from coach in last 5 days -> SELECT date_coach_selection, num_coach_selected, percent_dietplan_not_given, percent_dietplan_given_within_24_hours, percent_dietplan_given_within_48_hours, percent_dietplan_given_within_120_hours, overall_percent_dietplan_given FROM users_who_got_dietplan_from_yoga_coach WHERE date_coach_selection BETWEEN CURRENT_DATE - 5 AND CURRENT_DATE;
postgresql to get npu users who booked yoga coach in last 24 hours -> SELECT date_coach_selection, num_coach_selected, percent_not_scheduled, percent_scheduled_24_hours FROM users_who_booked_yoga_coach;
postgresql to get npu users who booked coach manually vs auto for today -> select date,users_purchased,experts_to_be_selected,perc_of_users_who_selected_all_coaches,perc_user_selected_all_coaches,perc_auto_selected_all_coaches,one_coach_auto_selected from users_who_booked_coach_manually_vs_auto_overall where date = current_Date;
