postgresql to get npu users of three coach plan who booked coach manually vs auto for yesterday -> select date,users_purchased,experts_to_be_selected,percentage_of_users_who_selected_all_coaches,percentage_user_selected_all_coaches,percentage_auto_selected_all_coaches,percentage_one_coach_auto_selected from users_of_three_coach_plan_who_booked_coach_manually_vs_auto_day_wise where date = current_Date -1;
postgresql to get npu users of three coach plan who booked coach manually vs auto for current week -> select plan_start_week,avg_users_purchased,avg_experts_to_be_selected,avg_perc_of_users_who_selected_all_coaches,avg_perc_user_selected_all_coaches,avg_perc_auto_selected_all_coaches,avg_one_coach_auto_selected from users_of_three_coach_plan_who_booked_coach_manually_vs_auto_week_wise where plan_start_week = date_trunc('week', current_Date);
postgresql to get npu rating count for today -> select rating_date, rating_count from npu_users_who_gave_npu_ratings where rating_date = current_Date;
postgresql to get avg npu rating for today -> select rating_date, avg_npu_day from npu_users_who_gave_npu_ratings where rating_date = current_Date;
postgresql to get npu rating count for current week -> select rating_week, rating_count from npu_users_who_gave_npu_ratings_week_basis where rating_week = date_trunc('week', current_Date);
postgresql to get avg npu rating for present week -> select rating_week, avg_npu_week from npu_users_who_gave_npu_ratings_week_basis where rating_week = date_trunc('week', current_Date);
postgresql to get npu rating count for current month -> select rating_month, rating_count from npu_users_who_gave_npu_ratings where rating_month = date_trunc('month', current_Date);
postgresql to get npu avg_npu_day for current month -> select rating_month, avg_npu_month from npu_users_who_gave_npu_ratings where rating_month = date_trunc('month', current_Date);
postgresql to get get max users assigned to a hot -> SELECT COUNT(DISTINCT user_id) FROM mv_cp_purchases WHERE hot_email IS NOT NULL GROUP BY hot_email ORDER BY COUNT(DISTINCT user_id) DESC LIMIT 1;
postgresql to get count of users who got yoga plan yesterday -> SELECT num_coach_selected FROM users_who_booked_yoga_coach WHERE date_coach_selection = CURRENT_DATE - 1

